import './App.css';
import ReactDOM from 'react-dom/client';
import NavBar from './components/navbar/navbar'
import React from "react";
import Login from './components/login/login';
import {
  Container,
  Row,
  Col
} from 'react-bootstrap';
import {
  BrowserRouter,
  Route,
  Routes,
  Link,
} from "react-router-dom";


function App() {
  return (
    <div>
      <NavBar />
      <Router>
      <Routes>
        <Route
          path="/login"
          element={<Login />}
        ></Route>
      </Routes>
      </Router>
    </div>
  )
}

export default App;
